    function sendFunds(
        address beneficiary,
        uint256 amount
    ) private {
        if (amount > 0) {
            token.safeTransfer(beneficiary, amount);
                emit Payment(beneficiary, amount);
        } else {
            emit Payment(beneficiary, 0);
        }
    }

